import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./components/Home";
import AddTravel from "./components/AddTravel";
import AddComment from "./components/AddComment"; // La ruta debe ser correcta
import ViewTravels from "./components/ViewTravels";
import EditTravel from "./components/EditTravel";
import EditComment from "./components/EditComment";

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/add-travel" element={<AddTravel />} />
        <Route path="/add-comment" element={<AddComment />} />
        <Route path="/view-travels" element={<ViewTravels />} />
        <Route path="/edit-travel/:id" element={<EditTravel />} />
        <Route path="/edit-comment/:id" element={<EditComment />} />
      </Routes>
    </Router>
  );
}

export default App;
